WKBFormulaOrder=13;
WKBFormulaOrder::usage="WKBFormulaOrder is number of the implemented WKB orders";
WKBOrderList[\[Nu]_,V_List/;Length[V]>1&&IntegerQ[Length[V]/2]&&Length[V]<=WKBFormulaOrder*2]:=Join[{V[[1]],Sqrt[-2V[[2]]](\[Nu]+1/2)},Table[WKBOrders@@Prepend[Take[V,{2,k}],\[Nu]+1/2],{k,4,Length[V],2}]]
WKBOrderList::usage="WKBOrderList[n,{V0,V2...}] returns list of the eikonal WKB formula and the higher-order corrections, which can be used in the WKBOrderPade; V2, V3, V4... are the values of the derivatives at the potential peak, and n is the overtone number";


WKBSum[\[Epsilon]_,A_List/;Length[A]>1]:=A[[1]]\[Epsilon]-I A[[2]]\[Epsilon]^2+Sum[A[[i]]\[Epsilon]^i,{i,3,Length[A],2}]-Sum[I A[[2]]A[[i]]\[Epsilon]^i,{i,4,Length[A],2}];
WKBPade[0,A_List/;Length[A]>1]=WKBSum[1,A];
WKBPade[d_Integer/;d>0,A_List/;Length[A]>1]:=Module[{x},PadeApproximant[WKBSum[x,A],{x,0,{Length[A]-d,d}}]/.x->1]/;d<Length[A];
WKBPade::usage="WKBPade[m,list] returns square of the frequency calculated with the WKB formula for m=0, and with the Pade approximation with the denominator of order m; list can be generated by WKBOrderList function";


(*Solve equation for the peak position using a user-defined function and calculate all derivatives of the potential up to order o with respect to the tortoise coordinate*)
CalcPeakAndDerivatives[o_Integer/;o>0,U_,F_,{R_Symbol,R0_?NumericQ,FR_:FindRoot},MyPrecision_/;MyPrecision>0]:=Module[{V,Res},
V=Simplify[D[U,R]];
Res=FR[V==0,{R,SetPrecision[R0,MyPrecision]},WorkingPrecision->MyPrecision];
If[NumberQ[R/.Res],(*user-defined FR may return something wrong - calculate derivatives only if everything is ok!*)
V={F V//Simplify};
Do[AppendTo[V,F D[V//Last,R]//Simplify],{o-1}]
];
{Res,V}
]/;NumericQ[U/.R->R0]&&NumericQ[F/.R->R0];
(*List of all Pad\[EAcute] approximants for given WKB orders list*)
WKBPadeList=Table[WKBPade[m,Take[#,{1,i}]],{i,2,Length[#]},{m,0,i-1}]&;
WKBSumList=Table[WKBSum[1,Take[#,{1,i}]],{i,2,Length[#]}]&;


BasicWKBFormula[\[Nu]_,V_List/;Length[V]>1&&IntegerQ[Length[V]/2]&&Length[V]<=WKBFormulaOrder*2]:=WKBSum[1,WKBOrderList[\[Nu],V]];
BasicWKBFormula[\[Nu]_,V__/;Length[{V}]>1&&IntegerQ[Length[{V}]/2]&&Length[{V}]<=WKBFormulaOrder*2]:=WKBSum[1,WKBOrderList[\[Nu],{V}]];
