If[ListQ[d//Last],
Join[Sqrt[WKBOrderList[#,Prepend[d//Last//Rest,U]/.First[d]]//WKBSumList]&/@\[Nu]//Transpose//Reverse,d//First],
d//First] (*If something is wrong with the user-defined function, return the result.*)
]/;NumericQ[U/.R->R0]&&NumericQ[F/.R->R0];
WKBFormula::usage="WKBFormula[O,V[r],f[r],{r,r0},n,precision] calculates overtone n using WKB formulas up to the order O; r0 is the initial guess for the potential peak";


WKBFormulaPade[U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},T__]:=WKBFormulaPade[WKBFormulaOrder,U,F,L,T];
WKBFormulaPade[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},\[Nu]_Integer/;\[Nu]>=0]:=First[WKBFormulaPade[o,U,F,L,{\[Nu]},MachinePrecision]];
WKBFormulaPade[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},\[Nu]:{__Integer}/;Min[\[Nu]]>=0]:=WKBFormulaPade[o,U,F,L,\[Nu],MachinePrecision];
WKBFormulaPade[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},\[Nu]_Integer/;\[Nu]>=0,MyPrecision_/;MyPrecision>0]:=First[WKBFormulaPade[o,U,F,L,{\[Nu]},MyPrecision]];
WKBFormulaPade[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{R_Symbol,R0_?NumericQ,_:FindRoot},\[Nu]:{__Integer}/;Min[\[Nu]]>=0,MyPrecision_/;MyPrecision>0]:=Module[{d=CalcPeakAndDerivatives[2*o,U,F,L,MyPrecision]},
If[ListQ[d//Last],
Sqrt[WKBOrderList[#,Prepend[d//Last//Rest,U]/.First[d]]//WKBPadeList]&/@\[Nu],
d//First] (*If something is wrong with the user-defined function, return the result.*)
]/;NumericQ[U/.R->R0]&&NumericQ[F/.R->R0];
WKBFormulaPade::usage="WKBFormulaPade[O,V[r],f[r],{r,r0},n,precision] calculates overtone n using WKB Pad\[EAcute] approximants up to the order O; r0 is the initial guess for the potential peak";


SelectWKBValues[L:{__?NumericQ}]:=L[[#]]&/@Join[#,#+1]&[Ordering[Table[Abs[1-L[[i+1]]/L[[i]]],{i,Length[L]-1}],IntegerPart[(Length[L]+1)/3]]]/;Length[L]>1;
CalcWKBMean[L:{__?NumericQ}]:=Mean[L]//{#,Abs[L-#]^2//Mean//Sqrt}&;
PadeAverage[L:{__List}]:=PadeAverage/@L;
PadeAverage[L:{__?NumericQ}]:=CalcWKBMean[L//SelectWKBValues]/;Length[L]>1;
PadeAverage::usage="Averages values obtained using different Pad\[EAcute] approximants and estimates the order of error";


(*Solve the equation*)
SolveE[K_Symbol,Eq_Equal]:=K/.First[Solve[Eq,K]];
(*Find solution for K, which is the nearest to the Eikonal value*)
SolveK[K_Symbol,Eikonal_?NumericQ,W2_?NumericQ,lst_List,MyPrecision_/;MyPrecision>0]:=Quiet[Map[K/.FindRoot[#==W2,{K,Eikonal},WorkingPrecision->MyPrecision]&,lst,{2}],{FindRoot::"precw",FindRoot::"lstol"}];
SolveK[K_Symbol,W2_?NumericQ,lst_List,MyPrecision_/;MyPrecision>0]:=SolveK[K,N[SolveE[K,First@First[lst]==W2],MyPrecision],W2,lst,MyPrecision];


WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot}]:=Flatten[WKBCoeff[o,{0},U,F,L,MachinePrecision],1];
WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,W2_?NumericQ,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot}]:=Flatten[WKBCoeff[o,{W2},U,F,L,MachinePrecision],1];
WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,W2:{__?NumericQ},U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot}]:=WKBCoeff[o,W2,U,F,L,MachinePrecision];
WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},MyPrecision_/;MyPrecision>0]:=Flatten[WKBCoeff[o,{0},U,F,L,MyPrecision],1];
WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,W2_?NumericQ,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},MyPrecision_/;MyPrecision>0]:=Flatten[WKBCoeff[o,{W2},U,F,L,MyPrecision],1];
WKBCoeff[o_Integer/;o>0&&o<=WKBFormulaOrder,W2:{__?NumericQ},U_,F_,L:{R_Symbol,R0_?NumericQ,_:FindRoot},MyPrecision_/;MyPrecision>0]:=Module[{d=CalcPeakAndDerivatives[2*o,U,F,L,MyPrecision]},
If[ListQ[d//Last],
Join[First[SolveK[K,#,{WKBOrderList[K-1/2,Prepend[d//Last//Rest,U]/.First[d]]//WKBSumList},MyPrecision]]&/@W2//Transpose//Reverse,d//First],
d//First] (*If something is wrong with the user-defined function, return the result.*)
]/;NumericQ[U/.R->R0]&&NumericQ[F/.R->R0];
WKBCoeff::usage="WKBCoeff[O,w^2,V[r],f[r],{r,r0},precision] solves the WKB formulas up to the order O for given squared frequencies w^2 with respect to n-1/2; r0 is the initial guess for the potential peak";


SolveKAll[K_Symbol,W2_?NumericQ,lst_List,MyPrecision_/;MyPrecision>0]:=Quiet[Map[N[K/.Solve[#==W2,K],MyPrecision]&,lst,{2}],{Solve::"verif"}];
WKBCoeffPade[o_Integer/;o>0&&o<=WKBFormulaOrder,W2_?NumericQ,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot}]:=WKBCoeffPade[o,{W2},U,F,L,MachinePrecision]//First;
WKBCoeffPade[o_Integer/;o>0&&o<=WKBFormulaOrder,W2:{__?NumericQ},U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot}]:=WKBCoeffPade[o,W2,U,F,L,MachinePrecision];
WKBCoeffPade[o_Integer/;o>0&&o<=WKBFormulaOrder,W2_?NumericQ,U_,F_,L:{_Symbol,_?NumericQ,_:FindRoot},MyPrecision_/;MyPrecision>0]:=WKBCoeffPade[o,{W2},U,F,L,MyPrecision]//First;
WKBCoeffPade[o_Integer/;o>0&&o<=WKBFormulaOrder,W2:{__?NumericQ},U_,F_,L:{R_Symbol,R0_?NumericQ,_:FindRoot},MyPrecision_/;MyPrecision>0]:=Module[{d=CalcPeakAndDerivatives[2*o,U,F,L,MyPrecision]},If[ListQ[d//Last],
SolveKAll[K,#,WKBOrderList[K-1/2,Prepend[d//Last//Rest,U]/.First[d]]//WKBPadeList,MyPrecision]&/@W2,
d//First] (*If something is wrong with the user-defined function, return the result.*)
]/;NumericQ[U/.R->R0]&&NumericQ[F/.R->R0];
WKBCoeffPade::usage="WKBCoeffPade[O,w^2,V[r],f[r],{r,r0},precision] finds all soltions to all equations with Pad\[EAcute] approximants up to the order O for given squared frequencies w^2 with respect to n-1/2; r0 is the initial guess for the potential peak";


